Louise Glover (born 8 February 1983) is an English model, beauty queen, and photographer. She is well known from her work as a glamour model, with appearances in British lad mags, including FHM, Bizarre, Maxim, Loaded, and tabloids such as the News of the World, The Sun and The Daily Star. She is the first British model to be named \&quot;Model of the Year\&quot; in Playboy Special Editions.
